<link href="https://fonts.googleapis.com/css2?family=Roboto+Mono:wght@300&display=swap" rel="stylesheet"></link>

const layoutStyle = {
    margin: 5,
    padding: 5,
    fontfamily: 'Roboto Mono, monospace'

    // border: '1px solid #DDD',
};

const Layout = props => (
    <div style={layoutStyle}>
        <Header />
        {props.children}
    </div>
);

export default Layout;
